function plotData(data, plotRegLine=false){

     

  document.getElementById('tweetText').innerHTML = null

  dots = g.selectAll(".dots").data(data, d => d)

  x1 = d3.min(data, function(d) { return d.timestamp; })
  x2 = d3.max(data, function(d) { return d.timestamp ; })
  slope = data[0].slope
  intercept = data[0].intercept
  y1 = x1*slope + intercept
  y2 = x2*slope + intercept

  
  minY =  d3.min(data, function(d) { return d.sent ;})
  maxY = d3.max(data, function(d) { return d.sent; })
  yRange = [minY-.05, maxY+.05]  
  console.log(yRange)
  y = d3.scaleLinear()
        .domain(yRange)
        .range([ height, 0 ]);
  yAxis = d3.axisLeft(y)
  main.select(".y-axis")
          .transition().duration(1500)  
          .call(yAxis);  

  /*
  colorNegative = yRange[1]+(yRange[1]-yRange[0])*.25
  colorPositive = yRange[0]
  var color = d3.scaleSequential(d3["interpolate" + "Viridis"])
      .domain([colorNegative, colorPositive]);
  */

  regPoints = [x1, y1, x2, y2]

  

  console.log('update ' + dots.size())
  console.log('enter ' + dots.enter().size())
  console.log('exit ' + dots.exit().size())
          dots.enter().append("circle")
          .attr("class", "dots")
          .merge(dots)
          .attr("r", 7)
          .attr("cx", function (d,i) { return x(d.timestamp); } )
          .attr("cy", function (d) { return y(d.sent); } )
          .attr("fill", function(d){ return color(d.sent)})
          .on("mouseover", d => document.getElementById('tweetText').innerHTML = d.sample_tweets.replace(/NEWLINE/gi,'\n').replace(/SPACE/gi,' '))
          .on("mouseout", d => document.getElementById('tweetText').innerHTML = "\n".repeat((d.sample_tweets.match(/'NEWLINE'/gi) || []).length+1));
  dots.exit().remove()    

  if(plotRegLine){
    trendline = main.selectAll('.trendline');

    regLineSelection = d3.select(".reg-line")
    if(trendline.empty()){
      console.log('trendline is emtpy')
      console.log('update ' + trendline.size())
      console.log('enter ' + trendline.enter().size())
      console.log('exit ' + trendline.exit().size())
      main.append('line')
        .attr("class", "trendline")
        .attr("x1", function(d) { return x(regPoints[0]); })
        .attr("y1", function(d) { return y(regPoints[1]); })
        .attr("x2", function(d) { return x(regPoints[2]); })
        .attr("y2", function(d) { return y(regPoints[3]); })
        .attr("stroke", "red")
        .attr("stroke-width", 3)
    }
    else{
      trendline = main.selectAll('.trendline')
      console.log('trendline is not empty')
      trendline.transition().duration(1000)
            //.attr("d", regLine(data)) 
          .attr("x1", function(d) { return x(regPoints[0]); })
          .attr("y1", function(d) { return y(regPoints[1]); })
          .attr("x2", function(d) { return x(regPoints[2]); })
          .attr("y2", function(d) { return y(regPoints[3]); })
    }
  }
}

